import React, { Component } from "react"
import "../../assets/css/fengwei/cart.css"
import {Icon} from "antd"
class cart extends Component {
    render(){
        return(
            <div className="cart">
                <div className="bangding">
                    <Icon type="close-circle" />
                </div>
            </div>
        )
    }
}
export default cart
